/****** Object:  UserDefinedFunction [Function].[func_Get_new_Codigo]    Script Date: 4/13/2022 9:08:54 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:      <Author, , Name>
-- Create Date: <Create Date, , >
-- Description: <Description, , >
-- =============================================
CREATE FUNCTION [Function].[func_Get_new_Codigo]()
RETURNS VARCHAR(MAX)
AS
BEGIN
    -- Declare the return variable here
    DECLARE @ResultVar AS VARCHAR(MAX)

    -- Add the T-SQL statements to compute the return value here
    SET @ResultVar = ('ASAIC-' + CAST(YEAR(GETDATE()) AS VARCHAR(MAX)) + '-' + CAST((SELECT COUNT(*) + 1 FROM [Operacion].[Proyectos] WHERE YEAR([FechaCreacion]) = YEAR(GETDATE())) AS VARCHAR(MAX)))

    -- Return the result of the function
    RETURN @ResultVar
END
GO
